        <img className="admin-avatar" src="https://res.cloudinary.com/dlf8flk1o/image/upload/v1696729871/dashboard/Avatar_wxy7jv.png" alt="" />
      </div>

      <div className="text-container">
        <h3>Administrador</h3>
        <p>admin@tiendasound.com</p>
      </div>
    </div>
  );
}

export default AdminCard;
